script: |
  super -f text -I q8249.spq | sort > q8249.out

inputs:
  - name: q8249.spq
    data: |
      SELECT - 30 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 / - col2 NOT BETWEEN ( + ( + col0 ) ) AND + 51;
  - name: tab1

outputs:
  - name: q8249.out
    data: |
      -30
      -30
      -30
